import React, { Component } from 'react'
import { connect } from 'react-redux';
import { sideDrawerAction } from './redux/actions/sideDrawerController.js'
import { ReactComponent as Cross } from '../assets/cross.svg';

class SideDrawer extends React.Component {
  constructor() {
    super()
    this.state = {}
  }

  render() {
    return (
      <div>
        <div className='drawerContain'>
          <Cross className='exitMenuIcon' onClick={() => this.props.sideDrawerAction(false)} />
          <ul className='menuListMobile'>
            <li>
              <h3>About</h3>
            </li>
            <li>
              <h3>FAQ's</h3>
            </li>
            <li>
              <h3>Support</h3>
            </li>
          </ul>
        </div>
        <div className='backdrop' onClick={() => this.props.sideDrawerAction(false)} />
      </div>
    )
  }
}

function mapDispatchToProps(dispatch) {
  return {
    sideDrawerAction: modalState => dispatch(sideDrawerAction(modalState))
  };
}

export default connect(null, mapDispatchToProps)(SideDrawer);
